{% extends "blog/base.html" %}
{% load bootstrap5 %}
{% load static %}
{% block content %}

<style>

    @media screen and (max-width:530px){
        #form-md{
            display: none;
        }
        #form-sm{
            display: block;
        }
    }

    
    @media screen and (min-width:531px){
        #form-md{
            display: block;
        }
        #form-sm{
            display: none;
        }
    }


</style>









<br>
<div class="d-flex justify-content-center"> 
    <div>   
<div id="form-sm" class="container-fluid">
    <div class="col-12">
        <form method="post" action="{% url 'users:register' %}">
            {% csrf_token %}
            {% bootstrap_form form %}
            
            {% buttons %}
            <button class="btn btn-outline-success btn-sm" name="submit">Register</button>
            {% endbuttons %}
         
        </form>
    </div>
</div>
</div>

</div>


<div id="form-md" class="container-fluid" style="width: 90%;">
    <div class="row">

        <div class="col-7">
            <form method="post" action="{% url 'users:register' %}">
                {% csrf_token %}
                {% bootstrap_form form %}
                
                {% buttons %}
                <button class="btn btn-outline-success btn-sm" name="submit">Register</button>
                {% endbuttons %}
             
            </form>
        </div>
        <div id="pic" class="col-5">
